import React, { useEffect, useState } from "react";
import { axiosInstance } from "../api/endpoint";

const MesDossiers = () => {
  const [dossiers, setDossiers] = useState([]);

  useEffect(() => {
    const fetchDossiers = async () => {
      try {
        const res = await axiosInstance.get("/dossiers/medecin");
        setDossiers(res.data);
      } catch (err) {
        console.error(err);
        alert("Erreur r√©cup√©ration dossiers");
      }
    };
    fetchDossiers();
  }, []);

  return (
    <div style={{ padding: "20px" }}>
      <h2>üìÇ Mes Dossiers</h2>
      {dossiers.length === 0 ? <p>Aucun dossier trouv√©.</p> :
        dossiers.map(d => (
          <div key={d._id} style={{ border: "1px solid #ccc", padding: "10px", marginBottom: "10px" }}>
            <p><strong>Patient :</strong> {d.patientId.fullName} ({d.patientId.email})</p>
            <p><strong>R√©sum√© :</strong> {d.resumeMedical}</p>
            <p><strong>Groupe sanguin :</strong> {d.groupeSanguin}</p>
          </div>
        ))
      }
    </div>
  );
};

export default MesDossiers;
